import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";

function App() {
  const list = Datas.map((data) => <li key={data.id}>{data.color}</li>);
  console.log();
  return (
    <div className="App">
      <h1>APP</h1>
      <ul>{list}</ul>
    </div>
  );
}

export default App;
